import "./footer.css";

const Footer = () => {
  return (
    <>
      <footer>
        <div className="contenido-footer d-flex align-items-center justify-content-around row">
          <div className="redes">
            <p className="text-center">LinkedIn</p>
          </div>
          <div className="copy">
            <h3 className="text-center">
              Todos los derechos reservados &copy;
            </h3>
          </div>
          <div className="correo">
            <p>Direccion de correo:</p>
            <a href="#">ruben.campanario.dieguez@gmail.com</a>
          </div>
        </div>
      </footer>
    </>
  );
};

export default Footer;
